ontology_addendum.graph:
@prefix co: <https://example.com/ont_cryogenics#> .
@prefix dcterms: <http://purl.org/dc/terms/> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .

co:CoolingTechnique a rdfs:Class ;
    rdfs:label "Cooling Technique" ;
    rdfs:comment "Methods used to achieve low temperatures in experimental setups." .

co:ExperimentalInvestigation a rdfs:Class ;
    rdfs:label "Experimental Investigation" ;
    rdfs:comment "A systematic study conducted to explore and understand phenomena in cryogenics." .

co:LiquidHeliumCooling a rdfs:Class ;
    rdfs:label "Liquid Helium Cooling" ;
    rdfs:comment "A cooling technique that utilizes liquid helium to reach cryogenic temperatures." ;
    rdfs:subClassOf co:CoolingTechnique .

co:Material a rdfs:Class ;
    rdfs:label "Material" ;
    rdfs:comment "A substance or mixture of substances that has specific physical properties." .

co:Measurement a rdfs:Class ;
    rdfs:label "Measurement" ;
    rdfs:comment "The process of obtaining quantitative data about a physical property." .

co:QuantumFluid a rdfs:Class ;
    rdfs:label "Quantum Fluid" ;
    rdfs:comment "A state of matter that exhibits quantum mechanical effects at macroscopic scales, typically at low temperatures." ;
    rdfs:subClassOf co:Material .

co:Superconductivity a rdfs:Class ;
    rdfs:label "Superconductivity" ;
    rdfs:comment "A phenomenon where a material exhibits zero electrical resistance and expulsion of magnetic fields at low temperatures." ;
    rdfs:subClassOf co:Material .

co:CryogenicsOntology a owl:Ontology ;
    rdfs:label "Cryogenics Ontology" ;
    dcterms:description "The Cryogenics Ontology provides a structured framework for representing knowledge in the field of low-temperature physics, particularly focusing on superconductivity and quantum fluids. It encompasses entities related to cryogenic materials, experimental techniques, and fundamental properties of quantum materials at ultra-low temperatures. This ontology aims to facilitate data interoperability and knowledge sharing in cryogenics research." ;
    dcterms:title "ont_cryogenics" ;
    rdfs:comment "Ontology for representing knowledge in low-temperature physics, focusing on superconductivity and quantum fluids." ;
    owl:versionInfo "1.0.0" .

co:SuperconductingTransitionTemperature a rdf:Property ;
    rdfs:label "Superconducting Transition Temperature" ;
    rdfs:comment "The temperature at which a material transitions into a superconducting state." ;
    rdfs:domain co:Superconductivity ;
    rdfs:range xsd:float .
